import React, {useEffect, useState} from "react";
import "./loginform.css"

function LoginForm(){
    var myHeaders = new Headers();
myHeaders.append("Accept", "application/json");

var formdata = new FormData();
formdata.append("email", "superadmin@gmail.com");
formdata.append("password", "password");

var requestOptions = {
  method: 'POST',
  headers: myHeaders,
  body: formdata,
  redirect: 'follow'
};

fetch("{{baseUrl}}/auth/login", requestOptions)
  .then(response => response.text())
  .then(result => console.log(result))
  .catch(error => console.log('error', error));
  
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    
    async function loginData(){
        let item = {email, password};
        console.log(item);
        let result = await fetch("https://staging.hospyta.com/auth/login", {
            method: "post",
            body: JSON.stringify(item),
            headers:{'Accept': 'application/json'},
        });
        result = await result.json();
        console.log(result);
        
    }

    return (
        <div className="cover">
            <h1>Login</h1>
            <input type="email" placeholder="email" onChange={(e) => setEmail(e.target.value)} className="form-control" />
            <input type="password" placeholder="password"  onChange={(e) => setPassword(e.target.value)} className="form-control" />

            <button onClick={loginData} className="btn btn-paimary">Login</button>

        </div>
    )
}

export default LoginForm
